DROP DATABASE IF EXISTS `mlm`;
CREATE DATABASE IF NOT EXISTS `mlm` /*!40100 DEFAULT CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci */;
USE `mlm`;


DROP TABLE IF EXISTS `client`;
CREATE TABLE IF NOT EXISTS `client` (
	`id_client` int(11) NOT NULL AUTO_INCREMENT,
	`client_name` varchar(64) NOT NULL,
	`client_fullname` varchar(128) DEFAULT NULL,
	`client_discount` decimal(5,2) NOT NULL DEFAULT 0.00,
	`client_street` varchar(64) DEFAULT NULL,
	`client_city` varchar(64) DEFAULT NULL,
	`client_zip` varchar(10) DEFAULT NULL,
	`client_region` varchar(64) DEFAULT NULL,
	`client_country` varchar(64) DEFAULT NULL,
	PRIMARY KEY (`id_client`) USING BTREE,
	KEY `client_name_client_fullname` (`client_name`,`client_fullname`),
	KEY `client_fullname` (`client_fullname`),
	KEY `client_discount` (`client_discount`),
	KEY `client_street` (`client_street`),
	KEY `client_city` (`client_city`),
	KEY `client_zip` (`client_zip`),
	KEY `client_region` (`client_region`),
	KEY `client_country` (`client_country`),
	FULLTEXT KEY `client_full_address` (`client_street`,`client_city`,`client_zip`,`client_region`,`client_country`)
);

DROP TABLE IF EXISTS `dealer`;
CREATE TABLE IF NOT EXISTS `dealer` (
	`id_dealer` int(11) NOT NULL AUTO_INCREMENT,
	`id_dealer_parent` int(11) DEFAULT NULL,
	`dealer_name` varchar(64) NOT NULL,
	`dealer_surname` varchar(64) DEFAULT NULL,
	`dealer_description` text DEFAULT NULL,
	`dealer_turn_over_excl_vat` decimal(12,2) NOT NULL DEFAULT 0.00,
	`dealer_turn_over_incl_vat` decimal(12,2) NOT NULL DEFAULT 0.00,
	PRIMARY KEY (`id_dealer`) USING BTREE,
	KEY `id_dealer_parent` (`id_dealer_parent`),
	KEY `dealer_name_dealer_surname` (`dealer_name`,`dealer_surname`),
	KEY `dealer_surname` (`dealer_surname`),
	KEY `dealer_turn_over_excl_vat` (`dealer_turn_over_excl_vat`),
	KEY `dealer_turn_over_incl_vat` (`dealer_turn_over_incl_vat`),
	FULLTEXT KEY `dealer_description` (`dealer_description`)
);

DROP TABLE IF EXISTS `order`;
CREATE TABLE IF NOT EXISTS `order` (
	`id_order` int(11) NOT NULL AUTO_INCREMENT,
	`id_dealer` int(11) DEFAULT NULL,
	`id_client` int(11) DEFAULT NULL,
	`order_price_excl_vat` decimal(12,2) NOT NULL DEFAULT 0.00,
	`order_price_incl_vat` decimal(12,2) NOT NULL DEFAULT 0.00,
	`order_date_submit` datetime NOT NULL,
	`order_date_dispatch` datetime DEFAULT NULL,
	`order_paid` tinyint(4) NOT NULL DEFAULT 0,
	`order_status` enum('NEW','PREPARING','DELIVERING','DONE') NOT NULL DEFAULT 'NEW',
	PRIMARY KEY (`id_order`),
	KEY `id_dealer` (`id_dealer`),
	KEY `id_client` (`id_client`),
	KEY `order_price_excl_vat` (`order_price_excl_vat`),
	KEY `order_price_incl_vat` (`order_price_incl_vat`),
	KEY `order_date_submit` (`order_date_submit`),
	KEY `order_date_dispatch` (`order_date_dispatch`),
	KEY `order_paid` (`order_paid`),
	KEY `order_status` (`order_status`),
	CONSTRAINT `FK_order_client` FOREIGN KEY (`id_client`) 
		REFERENCES `client` (`id_client`) 
			ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT `FK_order_dealer` FOREIGN KEY (`id_dealer`) 
		REFERENCES `dealer` (`id_dealer`) 
			ON DELETE NO ACTION ON UPDATE NO ACTION
);






